import React from 'react';
import ReactDOM from 'react-dom';

const name = "saurav";
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/200/200";
const img3 = "https://picsum.photos/200/250";
const img4 = "https://picsum.photos/200/200";

ReactDOM.render(
  <>
  <h1> my name is {name}</h1>

  <img src= {img1} />
  <img src= {img2} />
  <img src= {img3} />
  <a href="https://kryosssoftech.com/">
  <img src= {img4} />
  </a>
</>,
  document.getElementById("root")
);
